import logo from './logo.svg';
import {getCoinbasePrice, getCryptoPrice} from './common/APIUtils';
import './App.css';

function App() {
  const coinbasePrice = getCoinbasePrice('eth');
  const cryptoPrice = getCryptoPrice('eth');



  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {coinbasePrice}
        </p>
        <p>
          {cryptoPrice}
        </p>
      </header>
    </div>
  );
}

export default App;
